import React, { useEffect } from 'react'
import "./Home.css"
function Home() {
    useEffect(() => {
        if (!localStorage.getItem("loggedIn")) {
            localStorage.setItem("loggedIn", false)
        }
    })
    return (
        <div className="Home">
            <div classname="Post">home</div>
        </div>
    )
}

export default Home
